      </Note> */}
      <div className="links">
        <LinkToPage href="mailto:noahsjung@gmail.com">Email</LinkToPage>
        <LinkToPage href={resume} target="blank">
          Resume
        </LinkToPage>
        <LinkToPage
          href="https://www.linkedin.com/in/noahsjung/"
          target="blank"
        >
          LinkedIn
        </LinkToPage>
      </div>
    </FooterContainer>
  );
}

export default Footer;
